import React from "react";
// import {Component} from 'react';
import myImage from "./components/content/image/shiroishi.jpeg";
import consumer from "./components/content/image/consumer.jpg";
import "./App.css";
import Navbar from "./components/navbar/Navbar";
import Header from "./components/header/Header";

const App = () => {
  return (
    <div className="app-wrapper">
		<Header />    
		<Navbar />  
	  <div className="content">
        <div>
          <img src={myImage} alt="cyberpunk girl" />
        </div>
        <div className="content__ava_description">
          <img src={consumer} alt="cyberpunk consumer" />
          <div>
            <h3>Александра, 28 Мытищи</h3>
            <p>
              Думала разденусь ко мне все придут и я такая вау.
            </p>
          </div>
        </div>
        <div>My posts</div>
        <div>New post</div>
        <div>post 1</div>
        <div>post 2</div>
      </div>
    </div>
  );
};

export default App;
